import IndexImageStyles from './styles/IndexImageStyles';

export default function IndexImage({ catagory }) {
  return (
    <IndexImageStyles>
      <div>
      <h1 id={catagory}>{catagory}</h1>
      </div>
    </IndexImageStyles>
  );
}

